def encrypt(plaintext: bytes, password: str):
    key = getKey(password)
    aes = AES.new(key, AES.MODE_ECB)
    ciphertext = aes.encrypt(pad(plaintext, BLOCK_SIZE))
    base64_text = base64.b64encode(ciphertext)
    return base64_text.decode()
    
    
