def getKey(password:str) -> bytes:
    m = hashlib.md5()
    m.update(password.encode())
    key = bytes(m.hexdigest()[0:16], 'utf-8')
    return key

def doConnect(url: str, password: str) -> bool:
    cipher_text = encrypt(REQ_BODY, password)
    headers = {
        "User-Agent": "Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.125 Safari/537.36",
        "Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9",
        "Accept-Language": "zh-CN,zh;q=0.9,en-US;q=0.8,en;q=0.7",
        "Content-Type": "application/octet-stream",
        "Accept-Encoding": "gzip, deflate",
        "Cache-Control": "no-cache",
        "Pragma": "no-cache",
        "Connection": "close"
    }
    resp = requests.post(url, headers=headers, data=cipher_text, verify=False)
    if checkResp(resp):
        print("[+]", url, "Password:", password)
    

def checkResp(response: requests.Response) -> bool:
    # localResult = base64.b64decode(COMPARE_RESULT)
    if response.status_code != 200:
        return False
    elif len(response.content) != 3168:
        return False
    else:
        return True

    
